import React, {Component} from 'react';
import {connect} from "react-redux";
import ColectionsPriview from "../../components/priview-collection/collections-priview.component";
import {selectCollections} from "../../redux/shop/shop.selector";
import {createStructuredSelector} from "reselect";
import CollectionsOverview from "../../components/collections-overview/collection-overview.comopnent";


const ShopComponent =({collections})=>{
    return (
            <div className='shop-page'>
                <CollectionsOverview/>
            </div>
        );

}

const mapStateToProps = createStructuredSelector({
    collections:selectCollections
})

export default connect(mapStateToProps)(ShopComponent);
